import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import reportWebVitals from './reportWebVitals';
import {
    createBrowserRouter,
    RouterProvider,
  } from "react-router-dom";
import FourteenersApp from './components/FourteenersApp/FourteenersApp';
import Login from "./components/LoginUser/LoginUser";
import ErrorPage from "./components/ErrorPage/ErrorPage";
import PeakContainer, {
  loader as peakLoader,
} from './components/PeakContainer/PeakContainer';
import RegisterUser from './components/RegisterUser/RegisterUser';
import { getAllPeaks } from './services';

  const router = createBrowserRouter([
    {
      path: "/",
      element: <FourteenersApp />,
      // errorElement: <ErrorPage />,
    //   action: rootAction,
      children: [
        {
          errorElement: <ErrorPage />,
          children: [
            { index: true, 
              element: <PeakContainer />,
              loader: async () => {
                const peaks = await getAllPeaks();
                return peaks
              },
            },
            {
              path: 'login',
              element: <Login />,
              // action: loginAction,
            },
            {
              path: 'register',
              element: <RegisterUser />,
              // action: registerAction
            }
          ]
        }
      ],
    },
  ]);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.StrictMode>
        <RouterProvider router={router} />
    </React.StrictMode>
);

// put react.strict back when finished

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
